import React, { useState } from 'react';
import {Link} from "react-router-dom";

function TestPage() {
    const [response, setResponse] = useState('');

    const fetchData = async () => {
        try {
            const res = await fetch('http://localhost:8080/hello'); // Замените URL на ваш REST-эндпоинт
            const data = await res.text(); // Получаем текстовый ответ
            setResponse(data); // Устанавливаем ответ в состояние компонента
        } catch (error) {
            console.error('Ошибка при получении данных:', error);
        }
    };

    return (
        <div>
            <h1>Пример REST-запроса на Spring Boot приложение</h1>
            <button onClick={fetchData}>Отправить запрос</button>
            <div>
                <h2>Ответ:</h2>
                <pre>{response}</pre>
            </div>
        </div>
    );

}

export default TestPage;
